import React from 'react';

//import images
import Logo from '../assets/img/logo.svg'
import VisaImg from '../assets/img/visa.png'
import MasterCardImg from '../assets/img/mastercard.png'
import BitcoinImg from '../assets/img/bitcoin.png'


//import icons
import { IoLogoYoutube, IoLogoInstagram, IoLogoTwitter, IoLogoLinkedin } from 'react-icons/io';


const Footer = () => {
  return <footer className='lg:pt-24 pt-0'>
    <div className='container mx-auto lg:mb-24'>
      <div className='flex flex-col gap-12 lg:flex-row'>
        {/*Logo*/}
        <div className='flex-1 mx-auto lg:mx-0 mb-6 max-w-[285px]'>
          <a href='#'>
            <img src={Logo}></img>
          </a>
        </div>
        {/*links*/}
        <div className='flex flex-1 flex-col gap-16 lg:flex-row'>
          <div className='text-center w-full lg:text-left'>
            <div className='text-xl font-medium mb-6'>Quick Links</div>
            <ul className='space-y-4 text-gray'>
              <li><a className='hover:text-blue transition' href='#'>Link1</a></li>
              <li><a className='hover:text-blue transition' href='#'>Link2</a></li>
              <li><a className='hover:text-blue transition' href='#'>Link3</a></li>
              <li><a className='hover:text-blue transition' href='#'>Link4</a></li>
              <li><a href='#'>Link5</a></li>
            </ul>
          </div>
          <div>Link group 2</div>
        </div>
        {/*payment*/}
        <div>payment</div>
      </div>
    </div>
    {/*copy and social*/}
    <div>copy and social</div>
  </footer>;
};

export default Footer;
